import React from 'react';
import { Meteor } from 'meteor/meteor';
import PropTypes from 'prop-types';
import { createContainer } from 'meteor/react-meteor-data';

import { Notes } from '../api/notes';
import NoteListHeader from './NoteListHeader';

export const NoteList = (props) => {
  return (
    // <div>
    //   <NoteListHeader/>
    //   NoteList { props.notes.length }
    // </div>
    <nav class="navbar-default navbar-static-side" role="navigation">
        <div class="sidebar-collapse">

            <a class="close-canvas-menu"><i class="fa fa-times"></i></a>

            <ul class="nav" id="side-menu">
                <li class="nav-header">
                    <div class="dropdown profile-element">
                        <a data-toggle="dropdown" class="dropdown-toggle" href="#">
                            <span class="clear"> <span class="block m-t-xs"> <strong class="font-bold">Example user</strong>
                             </span> <span class="text-muted text-xs block">user <b class="caret"></b></span> </span> </a>
                        <ul class="dropdown-menu animated fadeInRight m-t-xs">
                            <li><a href="#">Item</a></li>
                            <li><a href="#">Item</a></li>
                            <li class="divider"></li>
                            <li><a href="#">Item</a></li>
                        </ul>
                    </div>
                    <div class="logo-element">
                        IN+
                    </div>
                </li>
                <li class="{{isActivePath regex='pageOne'}}">
                    <a href="/pageOne"><i class="fa fa-dashboard"></i> <span class="nav-label">Page one</span> </a>
                </li>          <li class="{{isActivePath regex='pageTwo'}}">
                    <a href="/pageTwo"><i class="fa fa-diamond"></i> <span class="nav-label">Page two</span> </a>
                </li>
            </ul>

        </div>
    </nav>
  );
};

NoteList.propTypes = {
  notes: PropTypes.array.isRequired
};

export default createContainer(() => {
  Meteor.subscribe('notes');
  // Setting up code to pass in the users notes as the notes prop
  return {
    notes: Notes.find().fetch()
  };
}, NoteList);
